import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var AlignRight = createReactComponent("AlignRight", ["svg", defaultAttributes, [["line", {
  x1: "21",
  y1: "6",
  x2: "3",
  y2: "6",
  key: "1kn1du"
}], ["line", {
  x1: "21",
  y1: "12",
  x2: "9",
  y2: "12",
  key: "1g0nry"
}], ["line", {
  x1: "21",
  y1: "18",
  x2: "7",
  y2: "18",
  key: "1u9cht"
}]]]);
export default AlignRight;
